import "../styles/pages/Roadmap.css";

function Roadmap(){
    return(
        <div>
            <div>
                <h1>Vaga</h1>
                <textarea placeholder="Qual vaga quer se candidatar?"></textarea>
            </div>
            <div className="botoes">
                <button className="btnVoltar">VOLTAR</button>
                <button>DOWNLOAD</button>
            </div>
        </div>
    );
}

export default Roadmap;
